import React from 'react';
import { RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis, Radar, ResponsiveContainer } from 'recharts';
import { getAllCategories } from '../data/questions';

const Results = ({ results }) => {
  // Transform results for radar chart
  const chartData = getAllCategories().map(category => ({
    category: category.replace(' & ', '\n& '), // Line break for better display
    score: results[category] || 0,
    fullMark: 18 // Maximum possible score (6 questions Ã— 3 points)
  }));

  // Calculate percentile scores (transform -18 to +18 range to 0-100)
  const getPercentileScore = (score) => {
    return Math.round(((score + 18) / 36) * 100);
  };

  // Get interpretation of score
  const getScoreInterpretation = (score) => {
    const percentile = getPercentileScore(score);
    if (percentile >= 80) return 'Very Strong';
    if (percentile >= 60) return 'Strong';
    if (percentile >= 40) return 'Average';
    if (percentile >= 20) return 'Below Average';
    return 'Needs Development';
  };

  // Get color based on score
  const getScoreColor = (score) => {
    const percentile = getPercentileScore(score);
    if (percentile >= 80) return '#10B981'; // Green
    if (percentile >= 60) return '#059669'; // Dark green
    if (percentile >= 40) return '#F59E0B'; // Yellow
    if (percentile >= 20) return '#F97316'; // Orange
    return '#EF4444'; // Red
  };

  return (
    <div className="container">
      <div className="card results-container">
        <h2>Your EFlo Profile</h2>
        <p style={{ color: '#6b7280', marginBottom: '32px', fontSize: '17px' }}>
          Your personalized insights across nine executive functioning domains
        </p>

        <div className="radar-chart-container">
          <ResponsiveContainer width="100%" height={500}>
            <RadarChart cx="50%" cy="50%" outerRadius="80%" data={chartData}>
              <PolarGrid />
              <PolarAngleAxis 
                dataKey="category" 
                tick={{ fontSize: 12, fill: '#4A5568' }}
                className="radar-labels"
              />
              <PolarRadiusAxis 
                angle={90} 
                domain={[-18, 18]} 
                tick={{ fontSize: 10, fill: '#718096' }}
              />
              <Radar
                name="Score"
                dataKey="score"
                stroke="#667eea"
                fill="#667eea"
                fillOpacity={0.3}
                strokeWidth={2}
              />
            </RadarChart>
          </ResponsiveContainer>
        </div>

        <div className="category-scores">
          {getAllCategories().map(category => {
            const score = results[category] || 0;
            const percentile = getPercentileScore(score);
            const interpretation = getScoreInterpretation(score);
            const color = getScoreColor(score);

            return (
              <div key={category} className="category-card">
                <h3>{category}</h3>
                <div className="score" style={{ color }}>
                  {percentile}%
                </div>
                <div style={{ 
                  fontSize: '14px', 
                  color: '#718096', 
                  marginTop: '4px' 
                }}>
                  {interpretation}
                </div>
                <div style={{ 
                  fontSize: '12px', 
                  color: '#A0AEC0', 
                  marginTop: '8px' 
                }}>
                  Raw Score: {score > 0 ? '+' : ''}{score}
                </div>
              </div>
            );
          })}
        </div>

        <div style={{ 
          marginTop: '40px', 
          padding: '20px', 
          backgroundColor: '#F7FAFC', 
          borderRadius: '12px',
          textAlign: 'left'
        }}>
          <h3 style={{ marginBottom: '16px', color: '#2D3748' }}>Understanding Your Results</h3>
          <p style={{ lineHeight: '1.6', color: '#4A5568', marginBottom: '12px' }}>
            <strong>Score Ranges:</strong>
          </p>
          <ul style={{ lineHeight: '1.8', color: '#718096', paddingLeft: '20px' }}>
            <li><strong>80-100%:</strong> Very Strong - Excellent executive functioning in this area</li>
            <li><strong>60-79%:</strong> Strong - Good executive functioning with room for optimization</li>
            <li><strong>40-59%:</strong> Average - Typical executive functioning abilities</li>
            <li><strong>20-39%:</strong> Below Average - Some challenges that may benefit from attention</li>
            <li><strong>0-19%:</strong> Needs Development - Significant challenges requiring support</li>
          </ul>
          <p style={{ lineHeight: '1.6', color: '#4A5568', marginTop: '16px', fontSize: '14px' }}>
            Remember: This assessment provides insights for self-reflection and is not a diagnostic tool. 
            Consider consulting with a professional for comprehensive evaluation if needed.
          </p>
        </div>

        <button 
          className="btn btn-primary" 
          onClick={() => window.location.reload()}
          style={{ marginTop: '30px' }}
        >
          Take Test Again
        </button>
      </div>
    </div>
  );
};

export default Results;
